import React from "react";
import {Box, Grid, Typography, Button } from "@material-ui/core"

export default (props)=>{
    return(
        <Box>
            <Grid container>
                <Grid item xs>
                    <Typography variant="subtitle1">Fontend Dev</Typography>
                </Grid>

            </Grid>
        </Box>
    )
}
